import React from "react";
export default function About() {
  return (
    <div className="intersts">
      <h2>Intersts</h2>
      <ul>
        <li>Web development</li>
        <li>Backend</li>
        <li>Programming</li>
        <li>Problem Solving</li>
        <li>Machine Learning</li>
        <li>Databases</li>
        <li>Networks</li>
        <li>Algorithms</li>
        <li>Data Structures</li>
        <li>OOP</li>
      </ul>
    </div>
  );
}
